import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png'; // โลโก้ของเว็บ

const Navbar = () => {
  return (
    <nav className="bg-white shadow-md sticky top-0 z-50 text-base"> {/* เพิ่ม text-base */}
      <div className="max-w-7xl mx-auto px-6 py-4 flex items-center justify-between">
        {/* Logo และเมนูในฝั่งขวา */}
        <div className="flex items-center justify-start gap-12 w-full">
          {/* โลโก้ชิดซ้าย */}
          <Link to="/">
            <img src={logo} alt="Logo" className="h-12" /> {/* เพิ่มขนาด logo เป็น h-12 */}
          </Link>

          {/* เมนู */}
          <div className="flex items-center gap-8 font-semibold text-gray-800">
            <Link to="/" className="hover:text-yellow-500">Home</Link>
            <Link to="/shop" className="hover:text-yellow-500">Shop</Link>
            <Link to="/product" className="hover:text-yellow-500">Product</Link>
            <Link to="/news" className="hover:text-yellow-500">News</Link>
            <Link to="/page" className="hover:text-yellow-500">Page</Link>
            <Link to="/contact" className="hover:text-yellow-500">Contact</Link>
          </div>
        </div>

        {/* ปุ่ม Login */}
        <button className="bg-yellow-400 px-5 py-2.5 rounded-full font-semibold hover:bg-yellow-500">
          Login
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
